import React from 'react'

function PageNotFound() {
  return (
    <div style={{height:"82vh", background:"#121212", color:"limegreen", fontSize:"40px", fontWeight:"800", paddingTop:"10px", textAlign:"center", paddingTop:"150px", overflow:"hidden"}}>
      Erro, página não encontrada
